import React from 'react';

import {
    Card,
    CardActions,
    CardContent,
    Button,
    Typography,
    CardHeader,
    IconButton
} from '@material-ui/core';

import PlayArrowIcon from '@material-ui/icons/PlayArrow';

function SubjectCard(props) {
    console.log(props)
    return (
        <Card style={{marginBottom: "1%"}}>
           
           <CardContent display="flex">  
                <Typography display="flex" color='textPrimary' gutterBottom> {props.subject._id} - {props.subject.course_name} </Typography> 
                <IconButton display="flex" aria-label="play/pause">
                    <PlayArrowIcon/>
                </IconButton>
            </CardContent>

            <CardContent>  
                <Typography paragraph> {props.subject.description} </Typography>
            </CardContent>
            
            <CardActions>
                <Button target="_blank" color="primary" size='small'  href={props.subject.link}>Learn More</Button>
            </CardActions>
        
        </Card>
    );
}

export default SubjectCard;
